import imgs from "../Images/bg2.jpg";
export default function Contact() {
  return (
    <div className="flex bg-black text-white">
    <div className="left flex-1 flex justify-center content-center items-center">
      <div className="w-[400px] h-[400px] flex justify-center content-center items-center">
        <img src={imgs} alt="no image show" />
      </div>
    </div>

    <div className="right flex-1 content-center ml-4 flex-col space-y-2">
     
    </div>
  </div>
   
  )
}
